language: fr
word: multifilaires
type: adjectif
etymology: ""
definitions:
  - Qui est composé de plusieurs brins ou fils.
  - Se disait d'un conducteur constitué de plusieurs fils non isolés (on dit aujourd'hui conducteur câblé ou câble à un conducteur) ou d'un câble à plusieurs conducteurs isolés (on dit aujourd'hui câble multiconducteur).
